import org.apache.commons.math3.distribution.NormalDistribution
import org.apache.spark.mllib.random.RandomRDDs.uniformVectorRDD
import org.apache.spark.sql.expressions._
import org.apache.spark.sql.functions._
import org.apache.spark.sql.types._
import org.apache.spark.sql.{DataFrame, SparkSession}
import org.slf4j.LoggerFactory

import scala.collection.mutable.ListBuffer

object Montecarlo {
    private val logger = LoggerFactory.getLogger("Montecarlo")

    def main(args: Array[String]): Unit = {

        logger.info("Starting Montecarlo")

        // Zeppelin creates and injects sc (SparkContext) and sqlContext (HiveContext or SqlContext)
        // So you don't need create them manually

        // set up environment
        // val spark: SparkSession = SparkSession.builder.appName("Montecarlo")
        //   .config("spark.master", "local")
        //   .getOrCreate()
        // import spark.implicits._

        val windowSpec = Window.partitionBy().orderBy("Date")

        val stockSchema = StructType(
            Array(
                StructField("Date", DateType, nullable = false),
                StructField("MSFT", FloatType, nullable = true)
            )
        )

        val stockDF = sqlContext.read
          .format("com.databricks.spark.csv")
          .schema(stockSchema)
          .option("sep", ",")
          .option("header", "true")
          .load("file:///home/ashesh/Downloads/zeppelin-0.8.2-bin-netinst/notebook/2ET1A38QP/MSFT_2000.csv")
          .withColumn("change", $"MSFT" - lag("MSFT", 1).over(windowSpec))
          .withColumn("pct_change", $"change" / lag("MSFT", 1).over(windowSpec))
          .withColumn("log_returns", log1p("pct_change"))
        stockDF.createOrReplaceTempView("stockDF")
        if (logger.isDebugEnabled()) {
            stockDF.printSchema()
            stockDF.show(5)
        }

        val stockMean = stockDF.select(mean(stockDF("log_returns"))).first().getDouble(0)
        logger.info("stockMean: {}", stockMean)
        val stockVariance = stockDF.select(variance(stockDF("log_returns"))).first().getDouble(0)
        logger.info("stockVariance: {}", stockVariance)
        val stockStddev = stockDF.select(stddev(stockDF("log_returns"))).first().getDouble(0)
        logger.info("stockStddev: {}", stockStddev)
        val stockDrift = stockMean - (0.5 * stockVariance)
        logger.info("stockDrift: {}", stockDrift)


        val timeIntervals = 250
        val iterations = 10

        val normalDistribution = new NormalDistribution(0, 1)

        val dailyReturnArrayDF = uniformVectorRDD(spark.sparkContext, timeIntervals, iterations)
          .map(_.toArray.toIterable
            .map(x => Math.exp(stockDrift + stockStddev * normalDistribution.inverseCumulativeProbability(x))))
          .map(_.toArray).toDF("valueArray")
        if (logger.isDebugEnabled()) {
            dailyReturnArrayDF.printSchema()
            dailyReturnArrayDF.show(5)
        }

        val lastPrice = stockDF.select($"MSFT").collect()(stockDF.count().toInt - 1).getFloat(0)

        var priceList = new ListBuffer[List[Double]]()
        for (id <- 0 to timeIntervals) {
            if (id == 0) {
                priceList += List.fill(iterations)(lastPrice)
            } else {
                val x = priceList(id - 1)
                val y = dailyReturnArrayDF.select($"valueArray").collect()(id - 1).getSeq[Double](0)
                priceList += x.zip(y).map { case (x, y) => x * y }
            }
        }
        val priceListArrayDF = priceList.toDF("valueArray")

        val priceListDF: DataFrame = (0 until iterations).foldLeft(priceListArrayDF)((priceListArrayDF, num) =>
            priceListArrayDF.withColumn("c_" + (num + 1), $"valueArray".getItem(num)))
          .drop("valueArray")
        if (logger.isDebugEnabled()) {
            priceListDF.printSchema()
            priceListDF.show(5)
        }
        priceListDF.createOrReplaceTempView("priceListDF")
    }
}
